            {/* <Product products={this.state.filteredProducts} handleAddToCart={this.handleAddToCart}/> */}

          <Route path="/cart" component={Cart} />
          <Route path="/about" component={About} />
        </Switch>
        <Footer/>
      </div>
    </BrowserRouter>
  );
}

export default App;
